import "./App.css";
import About from "./Components/About";
import Contact from "./Components/Contact";
import Education from "./Components/Education";
import Navbar from "./Components/Navbar";
import "./Assets/Style";
function App() {
  return (
    <div className="App">
      <Navbar />
      <Contact />
      <Education />
      <About />
    </div>
  );
}

export default App;
